import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import { Navbar, AddList } from '../../components';

export default class Test extends Component {
  constructor(props) {
    super(props);
    this.handleAdd = this.handleAdd.bind(this);
    this.handleDelete = this.handleDelete.bind(this);
    this.state = {
      prodAdds: [],
    };
  }

  handleAdd(add) {
    const { prodAdds } = this.state;
    this.setState({
      prodAdds: [add, ...prodAdds],
    });
  }

  handleDelete(deleteId) {
    const { prodAdds } = this.state;
    this.setState({
      prodAdds: prodAdds.filter(({ id }) => (deleteId !== id)),
    });
  }

  render() {
    const { prodAdds } = this.state;
    return (
      <>
        <Navbar />
        <Link to="/">Esse não atualiza a página</Link>
        <AddList handleDelete={this.handleDelete} prodAdds={prodAdds} />
      </>
    );
  }
}
